      marginTop: "33px",
      width: "120px",
    },
  },
});
// end

class Cardnewinfo extends React.Component {
  // state
  constructor(props) {
    super(props);
    this.state = {
      cardno: "",
      validthrdate: "",
      validthryear: "",
      OTPNumber: "",
      disabled: true,
      disableVal: true,
      errdata: "",
      error: {},
      query: "",
      mobnumber: "",
    };
  }

  handleChange = (n, v) => {
    debugger;
    const state = this.state;
    state.error[n] = false;
    this.setState({
      ...state,
      [n]: v,
    });
  };
  handleClose = () => {
    const state = this.state;
    this.setState({
      ...state,
      open: !state.open,
    });
  };
  Clear = () => {
    this.setState({
      cardno: "",
      validthrdate: "",
      validthryear: "",
      OTPNumber: "",
    });
  };
  handlesubmit = () => {
    const state = this.state;

    //if (this.validate()) {
    // if (!state.data.length > 0) {
    this.setState({
      ...state,
      open: true,
      //errorsubmit: {
      //error: true,
      //msg: 'Please choose file'
      //}
    });
    return;
  };

  handleClear = () => {
    this.setState({
      cardno: "",
      validthrdate: "",
      validthryear: "",
      OTPNumber: "",
    });
  };

  txtFieldChange = (e) => {
    if ((e.which >= 48 && e.which <= 57) || e.which === 45) {
      return true;
    } else {
      e.preventDefault();
      return false;
    }
  };

  apiFetchEdit = async (api, playod, n) => {
    await axios
      .post(`${config.api_url}${api}`, playod)
      .then((res) => {
        if (n === "otp") {
          this.setState({ disabled: false });
          const body = {
            cardNumber: {
              length: 0,
            },
            cbsCardNum: "",
            cbsErrorMsg: "",
            cbsMobNum: "",
            channelId: "",
            code: "",
            institutionId: "",
            mobileNumber: this.state.mobnumber ? this.state.mobnumber : "",
            otac: "",
            otp: this.state.OTPNumber ? this.state.OTPNumber : "",
            otpId: "",
          };
          this.Otp("api/v1/otp/generate", body);
        } else if (n === "validate") {
          this.setState({ query: "success", disableVal: false });
        } else if (n === "submit") {
          this.props.history.push("/welcome");
        }
      })
      .catch((error) => {
        this.setState({
          errdata: error.message,
        });
      });
  };
  Otp = async (api, playod) => {
    await axios
      .post(`${config.api_url}${api}`, playod)
      .then((res) => {})
      .catch((error) => {
        this.setState({
          errdata: error.message,
        });
      });
  };

  validate = (n) => {
    var valerrlist;

    if (n === "otp") {
      valerrlist = ["cardno", "validthrdate", "validthryear"];
    } else if (n === "validate") {
      valerrlist = ["OTPNumber"];
    }
    const error = {};
    let isValidate = true;
    valerrlist.map((val) => {
      if (!this.state[val]) {
        error[val] = true;
        isValidate = false;
        if (this.state[val] === 0) {
          error[val] = false;
          isValidate = true;
        }
      } else {
        error[val] = false;
      }
      return error;
    });
    this.setState({ error: { ...error } });
    return isValidate;
  };

  handleOtp = async (n) => {
    if (this.validate(n)) {
      const state = this.state;

      const body = {
        flag: "s",
        instCode: "MYNT",
        reqMsgId: "",
        verifyCvvReq: [
          {
            cvv2: "",
            expDate: state.validthrdate
              ? state.validthrdate.value + state.validthryear.value
              : "",
            pan: "",
            reqId: "",
            vpan: state.cardno ? state.cardno : "",
          },
        ],
      };
      await this.apiFetchEdit("api/v1/verify/cvv", body, n);
    }
  };

  handleformsubmit = () => {
    this.handleClose();
    this.props.history.push("/changepassword");
  };

  handleOtpvalidate = async (n) => {
    const state = this.state;
    if (this.validate(n)) {
      const body = {
        cardNumber: {
          length: 0,
        },
        channelId: "",
        code: "",
        customerId: "",
        institutionId: "",
        mobileNumber: state.mobnumber ? state.mobnumber : "",
        otac: "",
        otp: state.OTPNumber ? state.OTPNumber : "",
        otpId: "",
        refId: "",
        referenceNumber: "",
      };

      await this.apiFetchEdit("api/v1/otp/validate", body, "validate");
      this.setState({ query: "progress" });
    }
  };

  render() {
    const { classes } = this.props;
    const {
      cardno,
      query,
      validthrdate,
      error,
      validthryear,
      OTPNumber,
      disabled,
      errdata,
      disableVal,
      mobnumber,
    } = this.state;
    const { usertype } = this.state;

    return (
      <Grid container className={classes.root}>
        <Container maxWidth="xl" className={classes.divs}>
          <Container>
            {/* end */}

            {/* Breadcrumbs component */}

            {/* end */}

            {/* card component one*/}
            <Card className={classes.card} variant="outlined">
              <CardContent className={classes.card_title}>
                Register your new card
              </CardContent>

              <Container>
                <div className={classes.body}>
                  <Grid container spacing={4}>
                    <Grid item xs={12} sm={6}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Enter Card Number
                      </Typography>
                      <TextField
                        size="small"
                        variant="outlined"
                        placeholder=" Card Number"
                        className={classes.input}
                        onKeyPress={(e) => {
                          this.txtFieldChange(e);
                        }}
                        onChange={(e) => {
                          this.handleChange("cardno", e.target.value);
                        }}
                        helperText={error.cardno && "Please enter your Card No"}
                        error={error.cardno && true}
                        value={cardno}
                      />
                    </Grid>

                    <Grid
                      item
                      xs={12}
                      sm={6}
                      md={6}
                      lg={6}
                      xl={6}
                      spacing={2}
                      style={{ width: "100%", display: "flex" }}
                    >
                      <Grid item container sm={6}>
                        <Grid item xs={12} sm={12} md={12}>
                          <Typography
                            variant="subtitle2"
                            className={classes.text_title}
                          >
                            Valid Thru
                          </Typography>
                          <div
                            style={{
                              display: "flex",
                              justifyContent: "space-between",
                            }}
                          >
                            <Autocomplete
                              fullWidth={false}
                              size="small"
                              value={validthrdate}
                              style={{ width: "90%" }}
                              name="validthrou"
                              options={[
                                { value: "01" },
                                { value: "02" },
                                { value: "03" },
                                { value: "04" },
                                { value: "05" },
                              ]}
                              getOptionLabel={(option) => option.value}
                              onChange={(e, v) =>
                                this.handleChange("validthrdate", v)
                              }
                              renderInput={(params) => (
                                <TextField
                                  {...params}
                                  helperText={
                                    error?.validthrdate && "Please choose date"
                                  }
                                  error={error?.validthrdate}
                                  variant="outlined"
                                  placeholder="08"
                                  className={classes.TextField}
                                />
                              )}
                            />
                          </div>
                        </Grid>
                      </Grid>

                      <Grid item container xs={12} sm={6}>
                        <Autocomplete
                          fullWidth={false}
                          size="small"
                          style={{ width: "100%", marginTop: "32px" }}
                          value={validthryear}
                          name="validyear"
                          options={[
                            { value: "2021" },
                            { value: "2022" },
                            { value: "2023" },
                            { value: "2024" },
                            { value: "2025" },
                          ]}
                          getOptionLabel={(option) => option.value}
                          onChange={(e, v) =>
                            this.handleChange("validthryear", v)
                          }
                          renderInput={(params) => (
                            <TextField
                              {...params}
                              helperText={
                                error?.validthryear && "Please Choose year"
                              }
                              error={error?.validthryear}
                              variant="outlined"
                              placeholder="2021"
                              className={classes.TextField}
                            />
                          )}
                        />
                      </Grid>
                    </Grid>

                    <Grid item container xs={12} sm={6} spacing={2}>
                      <Grid item xs={12} sm={12} md={7} lg={10}>
                        <Typography
                          variant="subtitle2"
                          className={classes.text_title}
                        >
                          Mobile number
                        </Typography>
                        <TextField
                          size="small"
                          variant="outlined"
                          placeholder=""
                          // disabled
                          style={{ width: "95%" }}
                          value={mobnumber}
                          onChange={(e) =>
                            this.handleChange("mobnumber", e.target.value)
                          }
                          className={classes.input}
                        />
                      </Grid>
                      <Grid
                        item
                        xs={12}
                        sm={6}
                        md={5}
                        lg={2}
                        className={classes.buttons}
                      >
                        <Button
                          className={classes.clear}
                          style={{ width: "95px" }}
                          onClick={() => this.handleOtp("otp")}
                        >
                          Send OTP
                        </Button>
                      </Grid>
                    </Grid>
                    <Grid
                      item
                      container
                      xs={12}
                      sm={6}
                      spacing={2}
                      className={classes.otpbox}
                    >
                      <Grid
                        item
                        xs={12}
                        sm={12}
                        md={6}
                        lg={10}
                        className={classes.enterOTP}
                      >
                        <Typography
                          variant="subtitle2"
                          className={classes.text_title}
                        >
                          Enter OTP Number
                        </Typography>
                        <TextField
                          size="small"
                          variant="outlined"
                          placeholder="OTP Number"
                          className={classes.input}
                          onKeyPress={(e) => {
                            this.txtFieldChange(e);
                          }}
                          helperText={error?.OTPNumber && "Please Enter otp"}
                          error={error?.OTPNumber}
                          onChange={(e) => {
                            this.handleChange("OTPNumber", e.target.value);
                          }}
                          value={OTPNumber}
                        />
                        {query === "success" ? (
                          <>
                            <Fab aria-label="save" size="small" color="primary">
                              <CheckIcon />
                            </Fab>
                            OTP verfied successfully
                          </>
                        ) : (
                          <Fade
                            in={query === "progress"}
                            style={{
                              transitionDelay:
                                query === "progress" ? "800ms" : "0ms",
                            }}
                            unmountOnExit
                          >
                            <CircularProgress size="2rem" />
                          </Fade>
                        )}
                      </Grid>
                      {/* <Grid
                        style={{ marginTop: "auto" }}
                        item
                        xs={12}
                        sm={12}
                        md={3}
                        lg={3}
                      >
                        {query === "success" ? (
                          <Fab aria-label="save" size="small" color="primary">
                            <CheckIcon />
                          </Fab>
                        ) : (
                          <Fade
                            in={query === "progress"}
                            style={{
                              transitionDelay:
                                query === "progress" ? "800ms" : "0ms",
                            }}
                            unmountOnExit
                          >
                            <CircularProgress size="2rem" />
                          </Fade>
                        )}
                      </Grid> */}

                      <Grid
                        item
                        xs={12}
                        sm={12}
                        md={6}
                        lg={2}
                        className={classes.enterOTP1}
                      >
                        <Button
                          className={classes.clear1}
                          // disabled={disableVal}
                          disabled={disabled}
                          onClick={() => this.handleOtpvalidate("validate")}
                        >
                          validate
                        </Button>
                      </Grid>

                      <Grid item xs={12} sm={6} style={{ paddingTop: "0px" }}>
                        <Hidden xsUp>Enter OTP Number</Hidden>
                      </Grid>
                      <Grid
                        item
                        xs={12}
                        sm={6}
                        className={classes.enterOTP1}
                        style={{ paddingTop: "0px" }}
                      >
                        <Typography
                          onClick={() => this.Otp()}
                          variant="subtitle2"
                          className={classes.hint_title2}
                        >
                          Resend OTP
                          <ArrowRightIcon
                            style={{ position: "relative", top: "7px" }}
                          />
                        </Typography>
                      </Grid>
                    </Grid>

                    <Grid
                      container
                      direction="row"
                      justify="space-between"
                      alignItems="center"
                      className={classes.btns}
                    >
                      <Grid item>
                        {errdata ? (
                          <Button className={classes.clear2}>{errdata}</Button>
                        ) : (
                          ""
                        )}
                      </Grid>
                      <Grid
                        item
                        className={classes.submitbotton}
                        style={{ textAlign: "end", marginRight: "20px" }}
                      >
                        <Button
                          variant="contained"
                          className={classes.submit1}
                          disabled={disableVal}
                          onClick={() => this.handlesubmit()}
                        >
                          SUBMIT
                        </Button>
                        <Button
                          className={classes.clear2}
                          onClick={() => this.handleClear()}
                        >
                          CLEAR
                        </Button>
                      </Grid>
                    </Grid>
                  </Grid>
                </div>
              </Container>
            </Card>
            {/* end */}

            {/* card component two*/}

            {/* end */}

            {/* PhoneInTalkIcon section */}

            {/* end */}
          </Container>
        </Container>
      </Grid>
    );
  }
}

export default withStyles(styles)(withRouter(Cardnewinfo));
